import "./App.css";
import {Routes,Route,BrowserRouter} from "react-router-dom"

const App = () => {
  
  return (
    <>
     <BrowserRouter>
      <Routes>
        <Route/>
      </Routes>
     </BrowserRouter>
    </>
  );
};

export default App;
